#
# Config Menu
# ===========
# This file holds configuration of the /usb config menu.
config.yml:
  # blacklist contains paths that should be totally excluded from the menu
  blacklist:
    - version
    - force-replace
    - dirty

  # readonly contains paths that should not be editable from the menu
  readonly:
    - options.general.spawnSize
    - options.general.worldName
    - options.island.protectionRange
    - options.island.distance
    - options.island.height
    - nether.enabled

integer-menu:
  increment:
    '-1000': 'EMERALD'
    '-100': 'DIAMOND'
    '-10': 'GOLD_INGOT'
    '-1': 'IRON_INGOT'
    '1': 'IRON_INGOT'
    '10': 'GOLD_INGOT'
    '100': 'DIAMOND'
    '1000': 'EMERALD'
  number-items:
    0: 'ENDER_PEARL'
    1: 'LEVER'

